import { StyleSheet, Text, View } from "react-native";
import React from "react";

export default function History() {
  return (
    <View>
      <Text>History</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});
